import "./style.css";
import React, { Component, Fragment } from "react";
class Login extends Component {
  state = {};

  render() {
    return (
      <Fragment>
        <p> This is Login page</p>
        <button>
          <Link to="Game">click me to play</Link>
        </button>
      </Fragment>
    );
  }
}

export default Login;
